// src/pages/Contact.js
import React from 'react'; 
import img5650 from '../assets/IMG_5650.JPG';


const ContactBox = styled(BentoBox)`
background: #fff;
border-radius: 10px;
box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
`;
function Contact() {
  return (
    <div>
      <ContactBox>
  <BoxTitle>Contact us</BoxTitle>

  <div style={{ display: 'flex', justifyContent: 'space-between', flexWrap: 'wrap' }}>
    <div style={{ textAlign: 'center', margin: '10px' }}>
      <img 
        src={img5650} 
        alt="Aditya Mehta" 
        style={{ width: '200px', height: '200px', borderRadius: '10px', marginBottom: '10px' }} 
      />
      <BoxDescription>
        Phone: +91 9429428442<br />
        Email: mehta.aditya@iitgn.ac.in<br />
        Address: IIT Gandhinagar
      </BoxDescription>
    </div>

    <div style={{ textAlign: 'center', margin: '10px' }}>
      <img 
        src={img5650} 
        alt="Aditya Mehta" 
        style={{ width: '200px', height: '200px', borderRadius: '10px', marginBottom: '10px' }} 
      />
      <BoxDescription>
        Phone: +91 9429428442<br />
        Email: mehta.aditya@iitgn.ac.in<br />
        Address: IIT Gandhinagar
      </BoxDescription>
    </div>

    <div style={{ textAlign: 'center', margin: '10px' }}>
      <img 
        src={img5650} 
        alt="Aditya Mehta" 
        style={{ width: '200px', height: '200px', borderRadius: '10px', marginBottom: '10px' }} 
      />
      <BoxDescription>
        Phone: +91 9429428442<br />
        Email: mehta.aditya@iitgn.ac.in<br />
        Address: IIT Gandhinagar
      </BoxDescription>
    </div>

    <div style={{ textAlign: 'center', margin: '10px' }}>
      <img 
        src={img5650} 
        alt="Aditya Mehta" 
        style={{ width: '200px', height: '200px', borderRadius: '10px', marginBottom: '10px' }} 
      />
      <BoxDescription>
        Phone: +91 9429428442<br />
        Email: mehta.aditya@iitgn.ac.in<br />
        Address: IIT Gandhinagar
      </BoxDescription>
    </div>
  </div>
</ContactBox>
    </div>
  );
}

export default Contact;
